import classes from "./Card.module.css";
const Card = (props) => {
  return (
    <div className={classes.cardcontainer}>
      <div className={classes.cardimg}>
        <img
          src="https://ichef.bbci.co.uk/live-experience/cps/624/cpsprodpb/1021E/production/_130487066_gettyimages-1556856114.jpg"
          alt=""
        />
      </div>
      <div className={classes.cardone} >
        <h3>Title</h3>
        <p>
        {props.title}
        </p>
      </div>
      <div className={classes.cardone}>
        <h3>Description</h3>
        <p>
        {props.description}
        </p>
      </div>
      <div className={classes.cardone}>
        <h3>Time</h3>
        <p>{props.publish}</p>
      </div>
      <div className={classes.cardbutton}>
        <button>Read More</button>
      </div>
    </div>
  );
};
export default Card;
